import * as React from 'react';
import { DataGrid } from '@material-ui/data-grid';

const columns = [
	{ field: 'id', headerName: 'STT', width: 70 },
	{ field: 'code', headerName: 'Mã thành viên', width: 130 },
	{ field: 'name', headerName: 'Tên đăng nhập', width: 130 },
	{
		field: 'phone',
		headerName: 'Số điện thoại',
		type: 'number',
		width: 90,
	},
];

const rows = [
	{ id: 1, code: 'Snow', name: 'Jon', age: 35 },
	{ id: 2, code: 'Lannister', name: 'Cersei', age: 42 },
	{ id: 3, code: 'Lannister', name: 'Jaime', age: 45 },
	{ id: 4, code: 'Stark', name: 'Arya', age: 16 },
	{ id: 5, code: 'Targaryen', name: 'Daenerys', age: null },
	{ id: 6, code: 'Melisandre', name: null, age: 150 },
	{ id: 7, code: 'Clifford', name: 'Ferrara', age: 44 },
	{ id: 8, code: 'Frances', name: 'Rossini', age: 36 },
	{ id: 9, code: 'Roxie', name: 'Harvey', age: 65 },
];

export const MembersListContent = () => {
	return (
		<div style={{ height: 400, width: '100%' }}>
			<DataGrid rows={rows} columns={columns} pageSize={5} checkboxSelection />
		</div>
	);
};
